def calculate_max_seedling_size(n, m, growth_table):
    dp = [[0.0 for _ in range(n)] for _ in range(m)]
    for i in range(n):
        dp[0][i] = 2.0
    for k in range(1, m):
        for i in range(n):
            for j in range(n):
                dp[k][j] = max(dp[k][j], dp[k - 1][i] * growth_table[i][j])
    max_size = max(dp[m - 1])
    return round(max_size, 2)

